(21, 'Alberttak', 'Enquiry Grocio Contact Form.!', 'igraefe@yahoo.com', '83324525986', 'The prostate gland is central to the portion of a male\'s reproductive :. It secretes fluids that help the transportation and activation of sperm. The prostate is located just before the rectum, below the bladder and surrounding the urethra. When there is prostate problem, it will always be very uncomfortable and inconvenient for that patient as his urinary method is directly affected. \r\n \r\nThe common prostate medical problems are prostate infection, enlarged prostate and cancer of prostate. \r\n \r\n \r\n \r\nProstate infection, also referred to as prostatitis, is easily the most common prostate-related overuse injury in men younger than 55 years. Infections with the prostate are classified into four types - acute bacterial prostatitis, chronic bacterial prostatitis, chronic abacterial prostatitis and prosttodynia. \r\n \r\nAcute bacterial prostatitis could be the least common of most forms of prostate infection. It is brought on by bacteria located in the large intestines or urinary tract. Patients may go through fever, chills, body aches, back pains and urination problems. This condition is treated by making use of antibiotics or non-steroid anti-inflammatory drugs (NSAIDs) to ease the swelling. \r\n \r\nChronic bacterial prostatitis is really a condition associated with a particular defect inside gland and the persistence presence of bacteria inside urinary tract. It can be due to trauma towards the urinary tract or by infections via other parts in the body. A patient may feel testicular pain, spine pains and urination problems. Although it is uncommon, it could be treated by removal of the prostate defect then making use antibiotics and NSAIDs to treat the redness. \r\n \r\nNon-bacterial prostatitis accounts for approximately 90% coming from all prostatitis cases; however, researchers have not even to determine the sources of these conditions. Some researchers think that chronic non-bacterial prostatitis occur as a consequence of unknown infectious agents while other believe intensive exercise and heavy lifting can cause these infections. \r\n \r\nMaintaining a Healthy Prostate \r\n \r\nTo prevent prostate diseases, a proper diet is important. These are some from the actions you can take to keep your prostate healthy. \r\n \r\n1. Drink sufficient water. Proper hydration is critical for our health and wellbeing and it will also keep your urinary track clean. \r\n \r\n2. Some studies declare that a number of ejaculations weekly will help to prevent prostate cancer. \r\n \r\n3. Eat steak sparingly. It has been shown that consuming a lot more than four meals of beef a week will heighten the risk of prostate diseases and cancer. \r\n \r\n4. Maintain a proper diet with cereals, vegetable and fruits to make sure sufficient intake of nutrients essential for prostate health. \r\n \r\nThe most crucial measure to look at to be sure a proper prostate would be to opt for regular prostate health screening. If you are forty years and above, you must go for prostate examination one or more times per year.', '2018-06-04 10:02:50', 1),
