pg\" /></li>\r\n	<li style=\"text-align:center\"><img alt=\"\" src=\"https://www.vipclub.com.co/images/spons-2.jpg\" /></li>\r\n	<li style=\"text-align:center\"><img alt=\"\" src=\"https://www.vipclub.com.co/images/spons-3.jpg\" /></li>\r\n</ul>\r\n\r\n<p>Obt&eacute;n 25% de descuento en el precio vigente de los Productos Seleccionados pagando la totalidad de la compra con la Tarjetas de Cr&eacute;dito Club VIP que cuenten con CVV (no aplica para pagos por PSE ni en otros comercios) y aplicando el cup&oacute;n VIP-TECH. El m&aacute;ximo descuento es de $1`500.000 sobre el precio vigente usando el cup&oacute;n VIP-TECH. M&aacute;s informaci&oacute;n y condiciones en www.vipclub.com.co/legales. Las tarjetas de Club VIP son exclusivamente un medio de pago de los productos y servicios enunciados, por lo tanto Club VIP no asume responsabilidad alguna sobre los productos o servicios adquiridos por el cliente con el uso de sus tarjetas. El descuento del 25% adicional sobre los productos mencionados aplica sobre el precio vigente esto es, que es acumulable con otras promociones. El precio normal, es el precio de venta al p&uacute;blico sin descuento, que se toma como referencia para la codificaci&oacute;n y venta, en condiciones no promocionales. La informaci&oacute;n contenida en el campo &quot;Saldo al dd/mm/aaaa&quot; puede diferir del saldo actual de puntos debido a que los estados de puntos emitidos los d&iacute;as lunes o martes despu&eacute;s de d&iacute;a festivo, tendr&aacute;n informaci&oacute;n de saldo de Tarjeta de Credito Club VIP y VIP COINS con corte al jueves anterior y los estados emitidos de martes a domingo, tendr&aacute;n informaci&oacute;n de saldo de Tarjeta de Credito Club VIP y VIP COINS calculada dos d&iacute;as antes de esta pieza informativa.</p>\r\n\r\n<p>Este correo electr&oacute;nico fue enviado a CRISTIAN.RUBIANO@GMAIL.COM<br />\r\nSi no desea mas informaci&oacute;n de parte de Club VIP , haga click aqu&iacute;</p>\r\n\r\n<p>Este correo electr&oacute;nico fue enviado a trav&eacute;s de Sign Realidad Aumentada Tech Services.<br />\r\nDirecci&oacute;n: Calle 67 No. 6 &ndash; 32 Bogot&aacute; - Colombia &copy;2018 Derechos Reservados</p>\r\n', '2019-01-31 12:46:13', 1);
