(10, 1, 1, 1, 10, 'wrist watch', 0xd8b3d8a7d8b9d8a920d8a7d984d98ad8af, 'wrist-watch', '2345', 'Voltage stabilizers are designed to maintain a constant voltage level and therefore protect various home appliances by saving them from unexpected voltage surges and power fluctuations and blessing them with long life. They can protect devices from voltage spikes and surges due to lightning. They also protect laptops, phone chargers and gaming consoles besides larger home appliances like television, air conditioner and music system.', , '<p><span style=\"color:rgb(0, 0, 0); font-family:soletoregular,open sans,helvetica,arial,sans-serif; font-size:15px\">Voltage stabilizers are designed to maintain a constant voltage level and therefore protect various home appliances by saving them from unexpected voltage surges and power fluctuations and blessing them with long life. They can protect devices from voltage spikes and surges due to lightning. They also protect laptops, phone chargers and gaming consoles besides larger home appliances like television, air conditioner and music system.</span></p>\r\n', , NULL, '', 0, NULL, 1, 0, 0, 0, NULL, 1, '2019-02-08 12:11:02', 1),
